import React, { Component } from "react";
import User from "./User";
export default class Users extends Component {
  render() {
    const { users } = this.props;
    return (
      <div>
        {users.map((user) => {
          return (
            <User
              key={user.id}
              name={user.name}
              salary={user.salary}
              department={user.department}
            />
          );
        })}
      </div>
    );
  }
}
